% scatteringFactorComponents Returns atomic scattering factor components
% used in computing atomic scattering factors
%
% This function returns atomic scattering factor components used in
% computing atomic scattering factors. Only atomic (and not ionic)
% scattering factors are available. The decision to not include ions was 
% made to match how VESTA computes scattering factors. Some normal
% scattering factor fit constants exist for elements for which anomalous
% scattering factors do not exist; if such an element is quiered, anomalous
% components are returned as zero-valued and a warning is issued. 
%
% The normal scattering factor components are strictly valid for
% sin(theta)/lambda ranging from 0 to 6 A^-1. The anomalous scattering
% factor components are tabulated from ~0.01 A to ~1000 A; querying outside
% of the tabulated range for a given element will produce 0 values.
%
%   [a, b, c, Z, f1, f2, frel, fNT] = ...
%   scatteringFactorComponents(eName, lambda)
%
%   -a, b, c, Z, f1, f2, frel, and fNT are the components required for
%    computing atomic scattering factors. See VESTA documentation or a
%    standard XRD textbook for more details.
%   -eName is the abbreviated element name (e.g. Helium is 'He')
%   -lambda is the x-ray wavelength in Angstrom.
%
%
% Created September 2021 - Nathan Brown (npbrown@sandia.gov)

